INSERT INTO `backupnote` VALUES (1,'#### win10常用命令\n    创建或删除目录\n        rd dir_name 删除空文件夹\n        rd /s 删除目录及其子目录喝文件夹\n        rd /s /q  强制删除文件夹，及所有子目录和文件，不需要提示\n    \n    创建或删除文件\n        type nul>file.txt\n        echo nul>nihao.py\n    \n        del file_name 删除文件（可用正则匹配文件ps：*.txt）\n\n#### 设置用户的密码\n    net user administrator 密码\n#### 命令行切换超级管理员用户\n    runas /user:administrator cmd\n#### 命令行激活administrator用户（win的administrator用户默认不能登录）\n    net user administrator /active:yes\n#### win下查询端口\n    查询所有端口\n        netstat -nao \n    查询指定端口\n        netstat -nao | findstr ‘port_num’\n    \n        taskkill /pid 24964 -f\n    成功: 已终止 PID 为 24964 的进程。\n    \n    重启电脑 ： \n        shutdown -r -t 0 立即重启\n\n#### win查看目录树\n    tree        查看目录\n    tree /f     包括目录下所有文件\n    ','2021-02-08 12:54:33.30','2021-02-08 12:54:33.304257',6,1,1),(2,'#### win10常用命令\n    创建或删除目录\n        rd dir_name 删除空文件夹\n        rd /s 删除目录及其子目录喝文件夹\n        rd /s /q  强制删除文件夹，及所有子目录和文件，不需要提示\n    \n    创建或删除文件\n        type nul>file.txt\n        echo nul>nihao.py\n    \n        del file_name 删除文件（可用正则匹配文件ps：*.txt）\n\n#### 设置用户的密码\n    net user administrator 密码\n#### 命令行切换超级管理员用户\n    runas /user:administrator cmd\n#### 命令行激活administrator用户（win的administrator用户默认不能登录）\n    net user administrator /active:yes\n#### win下查询端口\n    查询所有端口\n        netstat -nao \n    查询指定端口\n        netstat -nao | findstr ‘port_num’\n    \n        taskkill /pid 24964 -f\n    成功: 已终止 PID 为 24964 的进程。\n    \n    重启电脑 ： \n        shutdown -r -t 0 立即重启\n\n#### win查看目录树\n    tree        查看目录\n    tree /f     包括目录下所有文件\n    ','2021-02-08 13:21:05.62','2021-02-08 13:21:05.627479',6,1,1),(3,'#### win10常用命令\n    创建或删除目录\n        rd dir_name 删除空文件夹\n        rd /s 删除目录及其子目录喝文件夹\n        rd /s /q  强制删除文件夹，及所有子目录和文件，不需要提示\n    \n    创建或删除文件\n        type nul>file.txt\n        echo nul>nihao.py\n    \n        del file_name 删除文件（可用正则匹配文件ps：*.txt）\n\n#### 设置用户的密码\n    net user administrator 密码\n#### 命令行切换超级管理员用户\n    runas /user:administra