INSERT INTO `note` VALUES (9,'about_BeforeEach_AfterEach.help.txt','BeforeEach, AfterEach, BeforeAll, and AfterAll\r\n-------------------------------\r\n\r\nThe BeforeEach and AfterEach commands allow you to define setup and teardown tasks that are\r\nperformed at the beginning and end of every It block. This can eliminate duplication of code\r\nin test scripts, ensure that each test is performed on a pristine state regardless of their\r\norder, and perform any necessary clean-up tasks after each test.\r\n\r\nBeforeEach and AfterEach blocks may be defined inside of any Describe or Context. If they\r\nare present in both a Context and its parent Describe, BeforeEach blocks in the Describe scope\r\nare executed first, followed by BeforeEach blocks in the Context scope. AfterEach blocks are\r\nthe reverse of this, with the Context  AfterEach blocks executing before Describe.\r\n\r\nThe script blocks assigned to BeforeEach and AfterEach are dot-sourced in the Context or Describe\r\nwhich contains the current It statement, so you don\'t have to worry about the scope of variable\r\nassignments. Any variables that are assigned values within a BeforeEach block can be used inside\r\nthe body of the It block.\r\n\r\nBeforeAll and AfterAll are used the same way as BeforeEach and AfterEach, except that they are\r\nexecuted at the beginning and end of their containing Describe or Context block.  This is\r\nessentially syntactic sugar for the following arrangement of code:\r\n\r\nDescribe \'Something\' {\r\n    try\r\n    {\r\n        <BeforeAll Code Here>\r\n\r\n        <Describe Body>\r\n    }\r\n    finally\r\n    {\r\n        <AfterAll Code Here>\r\n    }\r\n}\r\n\r\nNote about syntax and placement\r\n-------------------------------\r\n\r\nUnlike most of the commands in a Pester script, BeforeEach, AfterEach, BeforeAll and AfterAll blocks\r\napply to the entire Describe or Context scope in which they are defined, regardless of the order of\r\ncommands inside the Describe or Context. In other words, even if an It block appears before BeforeEach\r\nor AfterEach in the tests file, the BeforeEach and AfterEach will still be executed.  Likewise, BeforeAll\r\ncode will be executed at the beginning of a Context or Describe block regardless of where it is found,\r\nand AfterAll code will execute at the end of the Context or Describe.\r\n\r\nExamples\r\n-------------------------------\r\n\r\nDescribe \'Testing BeforeEach and AfterEach\' {\r\n    $afterEachVariable = \'AfterEach has not been executed yet\'\r\n\r\n    It \'Demonstrates that BeforeEach may be defined after the It command\' {\r\n        $beforeEachVariable | Should Be \'Set in a describe-scoped BeforeEach\'\r\n        $afterEachVariable  | Should Be \'AfterEach has not been executed yet\'\r\n        $beforeAllVariable  | Should Be \'BeforeAll has been executed\'\r\n    }\r\n\r\n    It \'Demonstrates that AfterEach has executed after the end of the first test\' {\r\n        $afterEachVariable | Should Be \'AfterEach has been executed\'\r\n    }\r\n\r\n    BeforeEach {\r\n        $beforeEachVariable = \'Set in a describe-scoped BeforeEach\'\r\n    }\r\n\r\n    AfterEach {\r\n        $afterEachVariable = \'AfterEach has been executed\'\r\n    }\r\n\r\n    BeforeAll {\r\n        $beforeAllVariable = \'BeforeAll has been executed\'\r\n    }\r\n}\r\n',0,'2021-02-14 11:39:35.544154','2021-02-14 11:39:35.544154',1,2,1,1,1),(3,'吕泽 推荐.txt','看项目 : github\n\n练逻辑 : 刷题 应对面试 : leetcode\n\n上下课路上 知识积累  \n	公众号 : python程序员\n			算法爱好者\n	app :  \n 		掘进  牛客   知乎\n',2,'2021-02-08 12:20:13.570637','2021-02-08 12:20:13.570637',1,2,1,1,1),(6,'win10命令.md','#### win10常用命令\n    创建或删除目录\n        rd dir_name 删除空文件夹\n        rd /s 删除目录及其子目录喝文件夹\n        rd /s /q  强制删除文件夹，及所有子目录和文件，不需要提示\n    \n    创建或删除文件\n        type nul>file.txt\n        echo nul>nihao.py\n    \n        del file_name 删除文件（可用正则匹配文件ps：*.txt）\n\n#### 设置用户的密码\n    net user administrator 密码\n#### 命令行切换超级管理员用户\n    runas /user:administrator cmd\n#### 命令行激活administrator用户（win的administrator用户默认不能登录）\n    net user administrator /active:yes\n#### win下查询端口\n    查询所有端口\n        netstat -nao \n    查询指定端口\n        netstat -nao | findstr ‘port_num’\n    \n        taskkill /pid 24964 -f\n    成功: 已终止 PID 为 24964 的进程。\n    \n    重启电脑 ： \n        shutdown -r -t 0 立即重启\n\n#### win查看目录树\n    tree        查看目录\n    tree /f     包括目录下所有文件\n    ',0,'2021-02-08 12:22:53.260694','2021-02-09 10:05:50.050236',1,2,1,1,1),(8,'note','我是一个测试笔记	',2,'2021-02-14 11:16:39.801780','2021-02-14 11:16:39.801780',1,1,3,1,1),(10,'about_Mocking.help.txt','TOPIC\r\n	Mocking\r\n\r\nSYNOPSIS\r\n	Pester provides a set of Mocking functions making it easy to fake dependencies \r\n	and also to verify behavior. Using these mocking functions can allow you to \r\n	\"shim\" a data layer or mock other complex functions that already have their \r\n	own tests.\r\n\r\nDESCRIPTION\r\n	With the set of Mocking functions that Pester exposes, one can:\r\n\r\n	- Mock the behavior of ANY PowerShell command.\r\n	- Verify that specific commands were (or were not) called.\r\n	- Verify the number of times a command was called with a set of specified \r\n	 parameters.\r\n\r\nMOCKING FUNCTIONS\r\n	See Get-Help for any of the below functions for more detailed information.\r\n\r\n	Mock\r\n		Mocks the behavior of an existing command with an alternate \r\n		implementation.\r\n\r\n	Assert-VerifiableMocks\r\n		Checks if any Verifiable Mock has not been invoked. If so, this will \r\n		throw an exception.\r\n\r\n	Assert-MockCalled\r\n		Checks if a Mocked command has been called a certain number of times \r\n		and throws an exception if it has not.\r\n\r\nEXAMPLE\r\n  function Build ($version) {\r\n    Write-Host \"a build was run for version: $version\"\r\n  }\r\n\r\n  function BuildIfChanged {\r\n    $thisVersion = Get-Version\r\n    $nextVersion = Get-NextVersion\r\n    if ($thisVersion -ne $nextVersion) { Build $nextVersion }\r\n    return $nextVersion\r\n  }\r\n\r\n  $here = Split-Path -Parent $MyInvocation.MyCommand.Path\r\n  $sut = (Split-Path -Leaf $MyInvocation.MyCommand.Path) -replace \'\\.Tests\\.\', \'.\'\r\n  . \"$here\\$sut\"\r\n\r\n  Describe \"BuildIfChanged\" {\r\n    Context \"When there are Changes\" {\r\n      Mock Get-Version {return 1.1}\r\n      Mock Get-NextVersion {return 1.2}\r\n      Mock Build {} -Verifiable -ParameterFilter {$version -eq 1.2}\r\n\r\n      $result = BuildIfChanged\r\n\r\n      It \"Builds the next version\" {\r\n        Assert-VerifiableMocks\r\n      }\r\n      It \"returns the next version number\" {\r\n        $result | Should Be 1.2\r\n      }\r\n    }\r\n    Context \"When there are no Changes\" {\r\n      Mock Get-Version { return 1.1 }\r\n      Mock Get-NextVersion { return 1.1 }\r\n      Mock Build {}\r\n\r\n      $result = BuildIfChanged\r\n\r\n      It \"Should not build the next version\" {\r\n        Assert-MockCalled Build -Times 0 -ParameterFilter {$version -eq 1.1}\r\n      }\r\n    }\r\n  }\r\n\r\nMOCKING CALLS TO COMMANDS MADE FROM INSIDE SCRIPT MODULES\r\n\r\nLet\'s say you have code like this inside a script module (.psm1 file):\r\n\r\n  function BuildIfChanged {\r\n    $thisVersion = Get-Version\r\n    $nextVersion = Get-NextVersion\r\n    if ($thisVersion -ne $nextVersion) { Build $nextVersion }\r\n    return $nextVersion\r\n  }\r\n\r\n  function Build ($version) {\r\n    Write-Host \"a build was run for version: $version\"\r\n  }\r\n\r\n  # Actual definitions of Get-Version and Get-NextVersion are not shown here,\r\n  # since we\'ll just be mocking them anyway. However, the commands do need to\r\n  # exist in order to be mocked, so we\'ll stick dummy functions here\r\n\r\n  function Get-Version { return 0 }\r\n  function Get-NextVersion { return 0 }\r\n\r\n  Export-ModuleMember -Function BuildIfChanged\r\n\r\nYou wish to write a unit test for this module which mocks the calls to Get-Version\r\nand Get-NextVersion from the module\'s BuildIfChanged command. In older versions of\r\nPester, this was not possible. As of version 3.0, there are two ways you can perform\r\nunit tests of PowerShell script modules. The first is to inject mocks into a module:\r\n\r\nFor these example, we\'ll assume that the PSM1 file is named \"MyModule.psm1\", and that\r\nit is installed on your PSModulePath.\r\n\r\n  Import-Module MyModule\r\n\r\n  Describe \"BuildIfChanged\" {\r\n    Context \"When there are Changes\" {\r\n      Mock -ModuleName MyModule Get-Version { return 1.1 }\r\n      Mock -ModuleName MyModule Get-NextVersion { return 1.2 }\r\n\r\n      # Just for giggles, we\'ll also mock Write-Host here, to demonstrate that you can\r\n      # mock calls to commands other than functions defined within the same module.\r\n      Mock -ModuleName MyModule Write-Host {} -Verifiable -ParameterFilter {\r\n        $Object -eq \'a build was run for version: 1.2\'\r\n      }\r\n\r\n      $result = BuildIfChanged\r\n\r\n      It \"Builds the next version and calls Write-Host\" {\r\n        Assert-VerifiableMocks\r\n      }\r\n\r\n      It \"returns the next version number\" {\r\n        $result | Should Be 1.2\r\n      }\r\n    }\r\n\r\n    Context \"When there are no Changes\" {\r\n      Mock -ModuleName MyModule Get-Version { return 1.1 }\r\n      Mock -ModuleName MyModule Get-NextVersion { return 1.1 }\r\n      Mock -ModuleName MyModule Build { }\r\n\r\n      $result = BuildIfChanged\r\n\r\n      It \"Should not build the next version\" {\r\n        Assert-MockCalled Build -ModuleName MyModule -Times 0 -ParameterFilter {\r\n          $version -eq 1.1\r\n        }\r\n      }\r\n    }\r\n  }\r\n\r\nNotice that in this example test script, all calls to Mock and Assert-MockCalled have had the\r\n-ModuleName MyModule parameter added. This tells Pester to inject the mock into the module\'s scope,\r\nwhich causes any calls to those commands from inside the module to execute the mock instead.\r\n\r\nWhen you write your test script this way, you can mock commands that are called by the module\'s\r\ninternal functions. However, your test script is still limited to accessing the public, exported\r\nmembers of the module. If you wanted to write a unit test that calls Build directly, for example,\r\nit wouldn\'t work using the above technique. That\'s where the second approach to script module testing\r\ncomes into play. With Pester 3.0\'s InModuleScope command, you can cause entire sections of your test\r\nscript to execute inside the targeted script module. This gives you access to non-exported members of\r\nthe module. For example:\r\n\r\n  Import-Module MyModule\r\n\r\n  Describe \"Unit testing the module\'s internal Build function:\" {\r\n    InModuleScope MyModule {\r\n      $testVersion = 5.0\r\n      Mock Write-Host { }\r\n\r\n      Build $testVersion\r\n\r\n      It \'Outputs the correct message\' {\r\n        Assert-MockCalled Write-Host -ParameterFilter {\r\n          $Object -eq \"a build was run for version: $testVersion\"\r\n        }\r\n      }\r\n    }\r\n  }\r\n\r\nNotice that when using InModuleScope, you no longer need to specify a -ModuleName parameter when calling\r\nMock or Assert-MockCalled for commands within that module. You are also able to directly call the Build\r\nfunction, which the module does not export.\r\n\r\nSEE ALSO\r\n	Mock\r\n	Assert-VerifiableMocks\r\n	Assert-MockCalled\r\n    InModuleScope\r\n	Describe\r\n	Context\r\n	It\r\n',0,'2021-02-14 11:39:35.551135','2021-02-14 11:39:35.551135',1,2,1,1,1),(11,'about_Pester.help.txt','TOPIC\r\n	Pester\r\n\r\nSYNOPSIS\r\n	Pester is a BDD based test runner for PowerShell.\r\n\r\nDESCRIPTION\r\n	Pester provides a framework for running Unit Tests to execute and validate \r\n	PowerShell commands. Pester follows a file naming convention for naming \r\n	tests to be discovered by pester at test time and a simple set of \r\n	functions that expose a Testing DSL for isolating, running, evaluating and \r\n	reporting the results of PowerShell commands.\r\n\r\n	Pester tests can execute any command or script that is accessible to a \r\n	pester test file. This can include functions, cmdlets, modules and scripts. \r\n	Pester can be run in ad hoc style in a console or it can be integrated into \r\n	the Build scripts of a Continuous Integration system.\r\n\r\n	Pester also contains a powerful set of Mocking Functions that allow tests to \r\n	mimic and mock the functionality of any command inside of a piece of \r\n	PowerShell code being tested. See about_Mocking.\r\n\r\nCREATING A PESTER TEST\r\n	To start using Pester, you may use the New-Fixture function to scaffold both \r\n	a new implementation function and a test function.\r\n\r\n	C:\\PS>New-Fixture deploy Clean\r\n\r\n	Creates two files:\r\n	./deploy/Clean.ps1\r\n	function clean {\r\n\r\n	}\r\n\r\n    ./deploy/clean.Tests.ps1\r\n    $here = Split-Path -Parent $MyInvocation.MyCommand.Path\r\n    $sut = (Split-Path -Leaf $MyInvocation.MyCommand.Path) -replace \'\\.Tests\\.\', \'.\'\r\n    . \"$here\\$sut\"\r\n\r\n    Describe \"clean\" {\r\n\r\n        It \"does something useful\" {\r\n            $true | should be $false\r\n        }\r\n    }\r\n\r\n    Now you have a skeleton of a clean function with a failing test. Pester \r\n    considers all files containing *Tests.ps1 to be a test file (see \r\n    Invoke-Pester) and by default it will look for these files and run all \r\n    Describe blocks inside the file (See Describe). The Describe block can \r\n    contain several behavior validations expressed in It blocks (see It). \r\n    Each It block should test one thing and throw an exception if the test \r\n    fails. Pester will consider any It block that throws an exception to be a \r\n    failed test. Pester provides a set of extensions that can perform various \r\n    comparisons between the values emitted or altered by a test and an expected \r\n    value (see about_Should). \r\n\r\nRUNNNING A PESTER TEST\r\n	Once you have some logic that you are ready to test, run the Tests file directly, \r\n	usually by pressing F5 in your ISE. \r\n	\r\n	To run multiple test files, get summary for the test run, to get nUnit compatible XML\r\n	report or to get PesterResult object use the Invoke-Pester command. You can zero in on \r\n	just one test (Describe block) or an entire tree of directories.\r\n\r\n	function BuildIfChanged {\r\n		$thisVersion=Get-Version\r\n		$nextVersion=Get-NextVersion\r\n		if($thisVersion -ne $nextVersion) {Build $nextVersion}\r\n		return $nextVersion\r\n	}\r\n\r\n	$here = Split-Path -Parent $MyInvocation.MyCommand.Path\r\n    $sut = (Split-Path -Leaf $MyInvocation.MyCommand.Path) -replace \'\\.Tests\\.\', \'.\'\r\n    . \"$here\\$sut\"\r\n\r\n    Describe \"BuildIfChanged\" {\r\n    	Context \"When there are Changes\" {\r\n    		Mock Get-Version {return 1.1}\r\n    		Mock Get-NextVersion {return 1.2}\r\n    		Mock Build {} -Verifiable -ParameterFilter {$version -eq 1.2}\r\n\r\n    		$result = BuildIfChanged\r\n\r\n	        It \"Builds the next version\" {\r\n	            Assert-VerifiableMocks\r\n	        }\r\n	        It \"returns the next version number\" {\r\n	            $result | Should Be 1.2\r\n	        }\r\n        }\r\n    	Context \"When there are no Changes\" {\r\n    		Mock Get-Version -MockWith {return 1.1}\r\n    		Mock Get-NextVersion -MockWith {return 1.1}\r\n    		Mock Build {}\r\n\r\n    		$result = BuildIfChanged\r\n\r\n	        It \"Should not build the next version\" {\r\n	            Assert-MockCalled Build -Times 0 -ParameterFilter{$version -eq 1.1}\r\n	        }\r\n        }\r\n    }\r\n\r\n	C:\\PS>Invoke-Pester\r\n\r\n	This will run all tests recursively from the current directory downwards \r\n	and print a report of all failing and passing tests to the console.\r\n\r\nPESTER AND CONTINUOUS INTEGRATION\r\n	Pester integrates well with almost any build automation solution. You \r\n	could create a MSBuild target that calls Pester\'s convenience Batch file:\r\n\r\n	<Target Name=\"Tests\">\r\n	<Exec Command=\"cmd /c $(baseDir)pester\\bin\\pester.bat\" />\r\n	</Target>\r\n\r\n	This will start a PowerShell session, import the Pester Module and call \r\n	invoke pester within the current directory. If any test fails, it will \r\n	return an exit code equal to the number of failed tests and all test \r\n	results will be saved to Test.xml using NUnit\'s Schema allowing you to \r\n	plug these results nicely into most Build systems like CruiseControl, \r\n	TeamCity, TFS or Jenkins.\r\n\r\nOTHER EXAMPLES\r\n	Pester\'s own tests. See all files in the Pester Functions folder \r\n	containing *Tests.ps1\r\n	\r\n	Chocolatey tests. Chocolatey is a popular PowerShell based Windows \r\n	package management system. It uses Pester tests to validate its own \r\n	functionality.\r\n\r\nSEE ALSO\r\n	about_Mocking\r\n	Describe\r\n	Context\r\n	It\r\n	New-Fixture\r\n	Invoke-Pester\r\n	about_Should\r\n	about_TestDrive\r\n',0,'2021-02-14 11:39:35.556122','2021-02-14 11:39:35.556122',1,2,1,1,1),(12,'about_should.help.txt','TOPIC\r\n	Should\r\n\r\nSYNOPSIS\r\n	Provides assertion convenience methods for comparing objects and throwing \r\n	test failures when test expectations fail.\r\n\r\nDESCRIPTION\r\n	Should is an Extension of System.Object and can be used as a native type \r\n	inside Describe blocks. The various Should member methods can be invoked \r\n	directly from an object being compared. It is typically used in individual \r\n	It blocks to verify the results of an expectation. The Should method is \r\n	typically called from the \"actual\" object being compared and takes the \r\n	\"expected\" object as a parameter. Should includes several members that \r\n	perform various comparisons of objects and will throw a PesterFailure when \r\n	the objects do not evaluate to be comparable.\r\n\r\nSHOULD MEMBERS\r\n\r\n	Be\r\n		Compares one object with another for equality and throws if the two \r\n		objects are not the same.\r\n\r\n        $actual=\"Actual value\"\r\n        $actual | Should Be \"actual value\" # Test will pass\r\n        $actual | Should Be \"not actual value\"  # Test will fail\r\n\r\n    BeExactly\r\n        Compares one object with another for equality and throws if the two objects are not the same.  This comparison is case sensitive.\r\n\r\n        $actual=\"Actual value\"\r\n        $actual | Should BeExactly \"Actual value\" # Test will pass\r\n        $actual | Should BeExactly \"actual value\" # Test will fail\r\n        \r\n    BeLike\r\n        Users a wildcard to compare two objects. The comparision is not case sensitive.\r\n        \r\n        \"I am a value\" | Should BeLike \"*value\"  # Test will pass\r\n        \"I am a value\" | Should BeLike \"value\"  # Test will fail\r\n        \r\n        Tip: use [Management.Automation.WildcardPattern]::Escape() to escape wildcard-characters.\r\n        \r\n    BeLikeExactly\r\n        Users a wildcard to compare two objects. The comparision is case sensitive.\r\n        \r\n        \"I am a value\" | Should BeLike \"*value\"  # Test will pass\r\n        \"I am a value\" | Should BeLike \"*VALUE\"  # Test will fail\r\n        \r\n        Tip: use [Management.Automation.WildcardPattern]::Escape() to escape wildcard-characters.\r\n        \r\n    BeGreaterThan\r\n        Asserts that a number is greater than an expected value. Uses PowerShell\'s -gt operator to compare the two values.\r\n        \r\n        $Error.Count | Should BeGreaterThan 0\r\n\r\n    BeLessThan\r\n        Asserts that a number is less than an expected value. Uses PowerShell\'s -gt operator to compare the two values.\r\n        \r\n        $Error.Count | Should BeLessThan 1\r\n\r\n	Exist\r\n		Does not perform any comparison but checks if the object calling Exist \r\n		is present in a PS Provider. The object must have valid path syntax. It \r\n		essentially must pass a Test-Path call.\r\n\r\n        $actual=(Dir . )[0].FullName\r\n        Remove-Item $actual\r\n        $actual | Should Exist # Test will fail\r\n\r\n    Contain\r\n        Checks to see if a file contains the specified text.  This search is not case sensitive and uses regular expressions. \r\n        \r\n        Set-Content -Path TestDrive:\\file.txt -Value \'I am a file.\'\r\n        \'TestDrive:\\file.txt\' | Should Contain \'I Am\' # Test will pass\r\n        \'TestDrive:\\file.txt\' | Should Contain \'^I.*file$\' # Test will pass\r\n\r\n        \'TestDrive:\\file.txt\' | Should Contain \'I Am Not\' # Test will fail\r\n\r\n        Tip: Use [regex]::Escape(\"pattern\") to match the exact text.\r\n	    \r\n        Set-Content -Path TestDrive:\\file.txt -Value \'I am a file.\'\r\n        \'TestDrive:\\file.txt\' | Should Contain \'I.am.a.file\' # Test will pass\r\n        \'TestDrive:\\file.txt\' | Should Contain ([regex]::Escape(\'I.am.a.file\')) # Test will fail\r\n\r\n    ContainExactly\r\n        Checks to see if a file contains the specified text.  This search is case sensitive and uses regular expressions to match the text.\r\n\r\n        Set-Content -Path TestDrive:\\file.txt -Value \'I am a file.\'\r\n        \'TestDrive:\\file.txt\' | Should Contain \'I am\' # Test will pass\r\n        \'TestDrive:\\file.txt\' | Should Contain \'I Am\' # Test will fail\r\n\r\n    Match\r\n		Uses a regular expression to compare two objects. This comparison is not case sensitive.\r\n\r\n        \"I am a value\" | Should Match \"I Am\" # Test will pass\r\n        \"I am a value\" | Should Match \"I am a bad person\" # Test will fail\r\n\r\n        Tip: Use [regex]::Escape(\"pattern\") to match the exact text.\r\n\r\n        \"Greg\" | Should Match \".reg\" # Test will pass\r\n        \"Greg\" | Should Match ([regex]::Escape(\".reg\")) # Test will fail\r\n\r\n    MatchExactly\r\n        Uses a regular expression to compare two objects.  This comparison is case sensitive.\r\n\r\n        \"I am a value\" | Should MatchExactly \"I am\" # Test will pass\r\n        \"I am a value\" | Should MatchExactly \"I Am\" # Test will fail\r\n\r\n    Throw\r\n        Checks if an exception was thrown in the input ScriptBlock.\r\n\r\n        { foo } | Should Throw # Test will pass\r\n        { $foo = 1 } | Should Throw # Test will fail\r\n        { foo } | Should Not Throw # Test will fail\r\n        { $foo = 1 } | Should Not Throw # Test will pass\r\n\r\n        Warning: The input object must be a ScriptBlock, otherwise it is processed outside of the assertion.\r\n\r\n        Get-Process -Name \"process\" -ErrorAction Stop | Should Throw # Should pass, but the exception thrown by Get-Process causes the test to fail.\r\n\r\n    BeNullOrEmpty\r\n        Checks values for null or empty (strings). The static [String]::IsNullOrEmpty() method is used to do the comparison.\r\n\r\n        $null | Should BeNullOrEmpty # Test will pass\r\n        $null | Should Not BeNullOrEmpty # Test will fail\r\n        @()   | Should BeNullOrEmpty # Test will pass\r\n        \"\"    | Should BeNullOrEmpty # Test will pass\r\n\r\nUSING SHOULD IN A TEST\r\n\r\n	function Add-Numbers($a, $b) {\r\n	    return $a + $b\r\n	}\r\n\r\n	Describe \"Add-Numbers\" {\r\n\r\n	    It \"adds positive numbers\" {\r\n	        $sum = Add-Numbers 2 3\r\n	        $sum | should be 3\r\n	    }\r\n	}\r\n\r\n	This test will fail since 3 will not be equal to the sum of 2 and 3.\r\n\r\nSEE ALSO\r\n	Describe\r\n    Context\r\n	It\r\n',0,'2021-02-14 11:39:35.561109','2021-02-14 11:39:35.561109',1,2,1,1,1),(13,'about_TestDrive.help.txt','TOPIC\r\n	TestDrive\r\n\r\nSYNOPSIS\r\n	A PSDrive for file activity limited to the scope of a singe Describe or \r\n	Context block.\r\n\r\nDESCRIPTION	\r\n	A test may need to work with file operations and validate certain types of \r\n	file activities. It is usually desirable not to perform file activity tests \r\n	that will produce side effects outside of an individual test. Pester \r\n	creates a PSDrive inside the user\'s temporary drive that is accessible via a \r\n	names PSDrive TestDrive:. Pester will remove this drive after the test \r\n	completes. You may use this drive to isolate the file operations of your \r\n	test to a temporary store.\r\n\r\nEXAMPLE\r\n	function Add-Footer($path, $footer) {\r\n	    Add-Content $path -Value $footer\r\n	}\r\n\r\n	Describe \"Add-Footer\" {\r\n	    $testPath=\"TestDrive:\\test.txt\"\r\n	    Set-Content $testPath -value \"my test text.\"\r\n	    Add-Footer $testPath \"-Footer\"\r\n	    $result = Get-Content $testPath\r\n\r\n	    It \"adds a footer\" {\r\n	        (-join $result).Should.Be(\"my test text.-Footer\")\r\n	    }\r\n	}\r\n	\r\n	When this test completes, the contents of the TestDrive PSDrive will \r\n	be removed.\r\n\r\nSEE ALSO\r\n	Context\r\n	Describe\r\n	It\r\n	about_Should\r\n',0,'2021-02-14 11:39:35.566094','2021-02-14 11:39:35.566094',1,2,1,1,1),(14,'CHANGELOG.md','## 3.4.0 (February 29, 2016)\r\n  - Bug fix for PSv2 when no matching scripts are found by Invoke-Pester.  [GH-441]\r\n  - Added \"Should BeLike\" assertion.  [GH-456]\r\n  - Discarded unwanted pipeline output from BeforeEach / AfterEach / BeforeAll / AfterAll.  [GH-468]\r\n  - Allowed closures to be used as mocks.  [GH-465]\r\n  - Fixed invalid NUnit XML output if test script had a syntax error. [GH-467]\r\n  - Fix for mocking advanced functions that define a parameter named \'Args\'.  [GH-471]\r\n  - Fixed bug when trying to mock a command with a weird name containing a single quotation mark.  [GH-474]\r\n  - Fixed bug for mocking Cmdlets that do not contain any positional parameters.  [GH-477]\r\n  - Fixed bug when calling a mocked command from inside the mock.  [GH-478]\r\n  - Added PesterOption parameter, and a switch to tweak console output for better VSCode extension functionality.  [GH-479]\r\n\r\n## 3.3.14 (December 16, 2015)\r\n  - Fixed Coverage analysis output, which broke in 3.3.12.  [GH-440]\r\n\r\n## 3.3.13 (December 10, 2015)\r\n  - Fixed a bug where mocking Get-Command would result in infinite recursion.  [GH-437]\r\n\r\n## 3.3.12 (December 8, 2015)\r\n  - Fixed a bug with mocking dynamic parameters on latest Windows 10 / PSv5 builds.  [GH-419]\r\n  - Fix for NUnit XML export on .NET core.  [GH-420]\r\n  - Added Set-TestInconclusive command.  [GH-421]\r\n  - Mocking improvements for calling original commands with begin/process/end blocks. [GH-422]\r\n  - Case insensitive replacement of Test in help [GH-428]\r\n  - Improve stack trace and exception console output [GH-426]\r\n  - Added support for intercepting module-qualified calls to a mocked command. [GH-432]\r\n  - Improved Assert-MockCalled to allow it to be passed an alias as the -CommandName.\r\n\r\n## 3.3.11 (September 8, 2015)\r\n  - Fixed a bug where mocking New-Object would cause a stack overflow.  [GH-405]\r\n\r\n## 3.3.10 (August 14, 2015)\r\n  - Fully qualified calls to Get-Content within Mocking code, to avoid triggering client\'s mocked versions of that command. [GH-362]\r\n  - Fixed a scoping error when calling the original command if no parameter filters match the call.  [GH-362]\r\n  - Added Ignore alias for -Skip on the It command, and updated NUnit output to flag these tests as Ignored instead of Skipped, for better integration with things like TeamCity.  [GH-368]\r\n  - Added support for Unicode to Should Contain. [GH-378]\r\n  - Added support for side-by-side installations to chocolateyInstall.ps1.  [GH-401]\r\n\r\n## 3.3.9 (May 23, 2015)\r\n  - Fixed Describe\'s handling of TestName filter when multiple strings are passed to Invoke-Pester\'s -TestName parameter.\r\n  - Failing BeforeEach or AfterEach will fail the test [GH-326]\r\n  - Added BeOfType operator to the Should command. [GH-327]\r\n  - Fixed BeforeEach / etc parsing in PSv3+ so breakpoints and automatic variables ($PSCommandPath, etc) will work properly.  [GH-333]\r\n  - Fixed bug in \'Should Be\' when comparing strings, and null or empty strings are piped in to the Should command.  [GH-333]\r\n  - Added some calls to Write-Progress in the It command.  [GH-322]\r\n  - Bug fix when mocking functions that are in the global scope; the original functions were being lost when the Describe block ended.  [GH-323]\r\n  - Improved failed assertion output from Assert-MockCalled; now behaves more like Should.  [GH-324]\r\n  - Added -ExclusiveFilter parameter to Assert-MockCalled.  Works like -ParameterFilter, except there also must not be any calls to the mocked command which do _not_ match the filter.\r\n  - Added the \"bin\" folder to the PATH environment variable when installing from Chocolatey.  Also removed the hard-coded -OutputXml and -Strict parameters from this file; only -EnableExit is always used from the bat file now.  [GH-281]\r\n  - PassThru object (when used in conjunction with -CodeCoverage) now includes information about Hit commands in addition to Missed commands.  [GH-341]\r\n  - Improvements to support for mocking advanced fynctions with dynamic parameters.  [GH-346]\r\n  - Fix for PowerShell v2 bug when mocking commands that have an -ArgumentList parameter with validation attributes.  [GH-354]\r\n  - Fixed stack trace output when the call to Should is in a file other than the file that contains the It block. [GH-358]\r\n\r\n## 3.3.8 (April 15, 2015)\r\n  - Further mocking fixes around the use of $ExecutionContext in client scope.  [GH-307]\r\n\r\n## 3.3.7 (April 15, 2015)\r\n  - Added workaround for GetDynamicParameters() bug that was affecting mocks on the ActiveDirectory module in Windows 7. [GH-295]\r\n  - Revised Mocking code to avoid potential bugs when functions define parameters named $ExecutionContext or $MyInvocation. [GH-304]\r\n  - Mocked functions no longer call Get-MockDynamicParameters if the original function had no dynamicparam block. [GH-306]\r\n\r\n## 3.3.6 (March 19, 2015)\r\n  - Fix for mocking aliases for commands that are in scopes that Pester can\'t normally see. [GH-267]\r\n  - Added line information to test failure output in Should assertion failures. [GH-266]\r\n  - Added support for passing named parameters or positional arguments to test scripts, and for calling test scripts that are not named *.Tests.ps1.  [GH-272]\r\n  - Made Pester compliant with StrictMode.  [GH-274]\r\n  - Improved error message when InModuleScope finds multiple modules loaded with the same name. [GH-276]\r\n  - Updated build script to allow for custom root folder in the nupkg. [GH-254]\r\n  - Improved error messages for InModuleScope and Mock -ModuleName when multiple modules with the same name are loaded. Also enabled these commands to work if only one of the loaded modules is a Script module. [GH-278]\r\n  - Added some graceful handling of test code that has a misplaced break or continue statement. [GH-290]\r\n\r\n## 3.3.5 (January 23, 2015)\r\n  - Updated tests to allow PRs to be automatically tested, with status updates to GitHub, by our CI server.\r\n  - Added Snippets directory to the nuget packages, and updated code so the module won\'t fail to import if Snippets are missing.\r\n\r\n## 3.3.4 (January 22, 2015)\r\n  - No changes; publishing again to fix broken PowerShellGet upload.\r\n\r\n## 3.3.2 (January 19, 2015)\r\n  - Performance Improvements\r\n\r\n## 3.3.1 (January 12, 2015)\r\n  - Import ISESteroids snippets on load\r\n  - Updated Code Coverage analysis to be compatible with the PowerShell 5.0 AST when analyzing DSC configurations. [GH-249]\r\n\r\n## 3.3.0 (January 10, 2015)\r\n  - Validate manifest version, changelog version and tag version\r\n  - Added BeforeAll and AfterAll commands\r\n  - Updated code to take advantage of -ErrorAction Ignore in PowerShell v3+.\r\n  - Add ISESteroids snippets but do not import them\r\n\r\n## 3.2.0 (December 3, 2014)\r\n  - Added BeGreaterThan and BeLessThan assertions to Should.\r\n  - Add -Quiet parameter for Invoke-Pester that disables the output written to screen by Write-Host [GH-223]\r\n  - Fix Error output for TestDrive [GH-232]\r\n  - Add ExcludeTagFilter parameter [GH-234]\r\n  - Add different color schemes for dark and light backgrounds\r\n\r\n## 3.1.1 (October 29, 2014)\r\n  - Fix Skipped and Pending\r\n  - Fix output format on non-US systems\r\n\r\n## 3.1 (October 23, 2014)\r\n  - Fix mocking of Get-ItemProperty\r\n  - Fix mocking commands with parameters named $FunctionName, $ModuleName or $ArgumentList under some circumstances. [GH-215]\r\n  - Add Skipped and Pending test results\r\n  - Added support for parameterized tests to the It command.\r\n  - Deprecated -OutputXml parameter, added -OutputFile and -OutputFormat parameters.\r\n  - Added new updated NUnit export format.  Original format still available as -OutputFormat LegacyNUnitXml.\r\n  - Stopped forcing -ParameterFilter blocks to return explicit booleans, preventing some unnecessary null reference exceptions.\r\n\r\n## 3.0.3 (October 12, 2014)\r\n  - Can be installed from PowerShellGet\r\n  - Version updated to solve issue on PowerShellGet\r\n\r\n## 3.0.2 (September 8, 2014)\r\n  - Coverage Analysis now ignores closing conditions of do/while and do/until loops, which were giving false failures.  [GH-200]\r\n  - Calls to Functions and Cmdlets with dynamic parameters can now be mocked. [GH-203]\r\n  - Mock now avoids assigning strings to items in the Function provider, bypassing a PowerShell 3.0 bug.\r\n  - Bug fix when mocking executables or functions with no param block. [GH-209]\r\n  - Replace the nuget.exe with version 2.8.2 and set the Team City server to use the same version. \r\n\r\n## 3.0.1.1 (August 28, 2014)\r\n - Fixing wrong version in the manifest, publishing new version so I can update it on Nuget/Chocolatey\r\n\r\n## 3.0.1 (August 28, 2014)\r\n  - Fix nuspec specification to build the 3.0.0 package correctly\r\n  - Add verbose output for Be and BeExactly string comparison [GH-192]\r\n  - Fixed NUnit XML output (missing close tag for failure element.)  [GH-195]\r\n\r\n## 3.0.0 (August 21, 2014)\r\n  - Fix code coverage tests so they do not left breakpoints set [GH-149]\r\n  - Add better output for hashtables in code coverage [GH-150]\r\n  - Fix Invoke-Pester -OutputXml usage of relative paths \r\n  - Remove Validate-Xml function\r\n  - Remove legacy object adaptations support\r\n  - Remove tests testing usage of the global scope\r\n  - Add function name to Code coverage output [GH-152]\r\n  - Suppress pipeline output in Context / Describe [GH-155]\r\n  - Coverage Output Update [GH-156]\r\n  - Add initial implementation of BeforeEach / AfterEach [GH-158]\r\n  - CodeCoverage of files containing DSC Configurations [GH-163]\r\n  - Rolling back some earlier Pester Scope changes [GH-164]\r\n  - Legacy expectations cleanup [GH-165]\r\n  - Invoke-Pester tests path fix [GH-166]\r\n  - Assert-MockCalled default ModuleName fix. [GH-167]\r\n  - Output exception source when test fails [GH-147]\r\n  - Fix for PesterThrowFailureMessage on PowerShell 2.0. [GH-171]\r\n  - Pester.bat no longer enables StrictMode.  [GH-172]\r\n  - Fixed default behavior of fixture parameter in Describe and Context.  [GH-174]\r\n  - Syntax errors in test files, as well as terminating errors from Describe or Context blocks are now treated as failed tests.  [GH-168]\r\n  - Mock lifetime is no longer tied to It blocks. [GH-176]\r\n  - Add module manifest\r\n  - Added multiple lines to failure messages from Should Be and Should BeExactly. Updated console output code to support blank lines in failure messages and stack traces. [GH-185]\r\n  - Fixed stack trace information when test failures come from inside InModuleScope blocks, or from something other than a Should assertion.  [GH-183]\r\n  - Fixed stack trace information from Describe and Context block errors in PowerShell 2.0. [GH-186]\r\n  - Fixed a problem with parameter / argument resolution in mocked cmdlets / advanced functions.  [GH-187]\r\n  - Improved error reporting when Pester commands are called outside of a Describe block. [GH-188]\r\n  - Extensive updates to help files and comment-based help for v3.0 release. [GH-190]\r\n\r\n## 3.0.0-beta2 (July 4, 2014)\r\n  - Add code coverage [GH-148]\r\n  - Fix TestName \r\n  - Fix direct execution of tests when the script is dot-sourced to global scope [GH-144]\r\n  - Fix mock parameter filter in strict mode [GH-143]\r\n  - Fix nUnit schema compatibility\r\n  - Fix special characters in nUnit output\r\n  \r\n## 3.0.0-beta (June 24, 2014)\r\n  - Add full support for module mocking \r\n  - Isolate Pester internals from tested code [GH-139]\r\n  - Tests.ps1 files can be run directly [GH-139]\r\n  - Add It scope to TestDrive\r\n  - Add It scope to Mock\r\n  - Add Scope parameter to Assert-MockCalled\r\n  - Measure test time more precisely\r\n  \r\n## 2.1.0 (June 15, 2014)\r\n  - Process It blocks in memory [GH-123]\r\n  - Fixed -ExecutionPolicy in pester.bat [GH-130]\r\n  - Add support for mocking internal module functions, aliases, exe and filters. [GH-126]\r\n  - Fix TestDrive clean up [GH-129]\r\n  - Fix ShouldArgs in Strict-Mode [GH-134]\r\n  - Fix initialize $PesterException [GH-136]\r\n  - Validate Should Assertion methods [GH-135]\r\n  - Fix using commands without fully qualified names [GH-137]\r\n  - Enable latest strict mode when running Pester tests using Pester.bat\r\n\r\n## 2.0.4 (March 9, 2014)\r\n\r\n  - Fixed issue where TestDrive doesn\'t work with paths with . characters\r\n    [GH-52]\r\n  - Fixed issues when mocking Out-File [GH-71]\r\n  - Exposing TestDrive with Get-TestDriveItem [GH-70]\r\n  - Fixed bug where mocking Remove-Item caused cleanup to break [GH-68]\r\n  - Added -Passthu to Setup to obtain file system object references [GH-69]\r\n  - Can assert on exception messages from Throw assertions [GH-58]\r\n  - Fixed assertions on empty functions [GH-50]\r\n  - Fixed New-Fixture so it creates proper syntax in tests [GH-49]\r\n  - Fixed assertions on Object arrays [GH-61]\r\n  - Fixed issue where curly brace misalignment would cause issues [GH-90]\r\n  - Better contrasting output colours [GH-92]\r\n  - New-Fixture handles \".\" properly [GH-86]\r\n  - Fixed mix scoping of It and Context [GH-98] and [GH-99]\r\n  - Test Drives are randomly generated, which should allow concurrent Pester processes [GH-100] and [GH-94] \r\n  - Fixed nUnit test failing on non-US computers [GH-109]\r\n  - Add case sensitive Be, Contain and Match assertions [GH-107]\r\n  - Fix Pester template self-tests [GH-113]\r\n  - Time is output to the XML report [GH-95]\r\n  - Internal fixes to remove unnecessary dependencies among functions\r\n  - Cleaned up Invoke-Pester interface\r\n  - Make output better structured\r\n  - Add -PassThru to Invoke-Pester [GH-102], [GH-84] and [GH-46]\r\n  - Makes New-Fixture -Path option more resilient [GH-114]\r\n  - Make the New-Fixture input accept any path and output objects\r\n  - Move New-Fixture to separate script\r\n  - Remove Write-UsageForNewFixture\r\n  - Fix Should Throw filtering by exception message [GH-125]\r\n  \r\n## 2.0.3 (Apr 16, 2013)\r\n\r\n  - Fixed line number reported in pester failure when using new pipelined\r\n    should assertions [GH-40]\r\n  - Added describe/context scoping for mocks [GH-42]\r\n\r\n## 2.0.2 (Feb 28, 2013)\r\n\r\n  - Fixed exit code bug that was introduced in version 2.0.0\r\n\r\n## 2.0.1 (Feb 3, 2013)\r\n\r\n  - Renamed -EnableLegacyAssertions to -EnableLegacyExpectations\r\n\r\n## 2.0.0 (Feb 2, 2013)\r\n\r\n  - Functionality equivalent to 1.2.0 except legacy assertions disabled by\r\n    default. This is a breaking change for anyone who is already using Pester\r\n\r\n## 1.2.0 (Feb 2, 2013)\r\n\r\n  - Fixing many of the scoping issues [GH-9]\r\n  - Ability to tag describes [GH-35]\r\n  - Added new assertion syntax (eg: 1 | Should Be 1)\r\n  - Added \'Should Throw\' assertion [GH-37]\r\n  - Added \'Should BeNullOrEmpty\' assertion [GH-39]\r\n  - Added negative assertions with the \'Not\' keyword\r\n  - Added \'Match\' assertion\r\n  - Added -DisableOldStyleAssertions [GH-19] and [GH-27]\r\n  - Added Contain assertion which tests file contents [GH-13]\r\n\r\n## 1.1.1 (Dec 29, 2012)\r\n\r\n  - Add should.not_be [GH-38]\r\n\r\n## 1.1.0 (Nov 4, 2012)\r\n\r\n  - Add mocking functionality [GH-26]\r\n\r\n## Previous\r\n\r\nThis changelog is inspired by the\r\n[Vagrant](https://github.com/mitchellh/vagrant/blob/master/CHANGELOG.md) file.\r\nHopefully this will help keep the releases tidy and understandable.\r\n\r\n',0,'2021-02-14 11:39:35.572080','2021-02-14 11:39:35.572080',1,2,1,1,1),(15,'README.md','__Build Status:__ [![Build status](https://build.powershell.org/guestAuth/app/rest/builds/buildType:(id:Pester_TestPester)/statusIcon)](https://build.powershell.org/project.html?projectId=Pester&tab=projectOverview&guest=1)\r\n\r\nPester 3.0 has been released!  To see a list of changes in this version, refer to the [What\'s New in Pester 3.0?](https://github.com/pester/Pester/wiki/What\'s-New-in-Pester-3.0) Wiki page.\r\n\r\n---\r\n\r\nPester\r\n=======\r\nPester provides a framework for **running unit tests to execute and validate PowerShell commands from within PowerShell**. Pester consists of a simple set of functions that expose a testing domain-specific language (DSL) for isolating, running, evaluating and reporting the results of PowerShell commands.\r\n\r\nPester tests can execute any command or script that is accessible to a Pester test file. This can include functions, cmdlets, modules and scripts. Pester can be run in *ad-hoc* style in a console or **it can be integrated into the build scripts of a continuous integration (CI) system**.\r\n\r\n**Pester also contains a powerful set of mocking functions** in which tests mimic any command functionality within the tested PowerShell code.\r\n\r\nA Pester Test\r\n-------------\r\nBuildChanges.ps1\r\n\r\n```powershell\r\n\r\nfunction Build ($version) {\r\n  write-host \"A build was run for version: $version\"\r\n}\r\n\r\nfunction BuildIfChanged {\r\n  $thisVersion=Get-Version\r\n  $nextVersion=Get-NextVersion\r\n  if($thisVersion -ne $nextVersion) {Build $nextVersion}\r\n  return $nextVersion\r\n}\r\n```\r\n\r\nBuildChanges.Tests.ps1\r\n\r\n```powershell\r\n$here = Split-Path -Parent $MyInvocation.MyCommand.Path\r\n$sut = (Split-Path -Leaf $MyInvocation.MyCommand.Path) -replace \'\\.Tests\\.\', \'.\'\r\n. \"$here\\$sut\"\r\n\r\nDescribe \"BuildIfChanged\" {\r\n  Context \"When there are changes\" {\r\n    Mock Get-Version {return 1.1}\r\n    Mock Get-NextVersion {return 1.2}\r\n    Mock Build {} -Verifiable -ParameterFilter {$version -eq 1.2}\r\n\r\n    $result = BuildIfChanged\r\n\r\n      It \"Builds the next version\" {\r\n          Assert-VerifiableMocks\r\n      }\r\n      It \"Returns the next version number\" {\r\n          $result | Should Be 1.2\r\n      }\r\n    }\r\n  Context \"When there are no changes\" {\r\n    Mock Get-Version -MockWith {return 1.1}\r\n    Mock Get-NextVersion -MockWith {return 1.1}\r\n    Mock Build {}\r\n\r\n    $result = BuildIfChanged\r\n\r\n      It \"Should not build the next version\" {\r\n          Assert-MockCalled Build -Times 0 -ParameterFilter {$version -eq 1.1}\r\n      }\r\n    }\r\n}\r\n```\r\n\r\nRunning Tests\r\n-------------\r\n    C:\\PS> Invoke-Pester\r\n\r\nThis will run all tests inside of files named `*.Tests.ps1` recursively from the current directory and print a report of all failing and passing test results to the console.\r\n\r\n    C:\\PS> Invoke-Pester -TestName BuildIfChanged\r\n\r\nYou can also run specific tests by using the `-TestName` parameter of the `Invoke-Pester` command. The above example runs all tests with a `Describe` block named `BuildIfChanged`. If you want to run multiple tests, you can pass a string array into the `-TestName` parameter, similar to the following example:\r\n\r\n    C:\\PS> Invoke-Pester -TestName BuildIfChanged, BaconShouldBeCrispy\r\n\r\nContinuous Integration with Pester\r\n-----------------------------------\r\n\r\nPester integrates well with almost any build automation solution.  There are several options for this integration:\r\n\r\n- The `-OutputFile` parameter allows you to export data about the test execution.  Currently, this parameter allows you to produce NUnit-style XML output, which any modern CI solution should be able to read.\r\n- The `-PassThru` parameter can be used if your CI solution supports running PowerShell code directly.  After Pester finishes running, check the FailedCount property on the object to determine whether any tests failed, and take action from there.\r\n- The `-EnableExit` switch causes Pester to exit the current PowerShell session with an error code. This error code will be the number of failed tests; 0 indicates success.\r\n\r\nAs an example, there is also a file named `Pester.bat` in the `bin` folder which shows how you might integrate with a CI solution that does not support running PowerShell directly.  By wrapping a call to `Invoke-Pester` in a batch file, and making sure that batch file returns a non-zero exit code if any tests fail, you can still use Pester even when limited to cmd.exe commands in your CI jobs.\r\n\r\nWhenever possible, it\'s better to run Invoke-Pester directly (either in an interactive PowerShell session, or using CI software that supports running PowerShell steps in jobs). This is the method that we test and support in our releases.\r\n\r\nFor Further Learning:\r\n-----------------------------------\r\n* [Getting started with Pester](http://www.powershellmagazine.com/2014/03/12/get-started-with-pester-powershell-unit-testing-framework/)\r\n* [Testing your scripts with Pester, Assertions and more](http://www.powershellmagazine.com/2014/03/27/testing-your-powershell-scripts-with-pester-assertions-and-more/)\r\n* [Pester Wiki](https://github.com/pester/Pester/wiki)\r\n* [Google Discussion Group](https://groups.google.com/forum/?fromgroups#!forum/pester)\r\n* `C:\\PS> Import-Module ./pester.psm1; Get-Help about_pester`\r\n* Microsoft\'s PowerShell test suite itself is being converted into Pester tests. [See the PowerShell-Tests repository.](https://github.com/PowerShell/PowerShell-Tests)\r\n* Note: The following two links were for Pester v1.0.  The syntax shown, particularly for performing assertions with Should, is no longer applicable to later versions of Pester.\r\n    * [powershell-bdd-testing-pester-screencast](http://scottmuc.com/blog/development/powershell-bdd-testing-pester-screencast/)\r\n    * [pester-bdd-for-the-system-administrator](http://scottmuc.com/blog/development/pester-bdd-for-the-system-administrator/)\r\n',0,'2021-02-14 11:39:35.578062','2021-02-14 11:39:35.578062',1,2,1,1,1),(17,'cate_0[2].txt','/**/callback_getcategorydetails({\"data\":{\"lefttop\":[{\"id\":15635,\"positionID\":25}],\"centertop\":[{\"id\":15634,\"positionID\":26},{\"id\":15104,\"positionID\":26},{\"id\":14950,\"positionID\":26},{\"id\":14853,\"positionID\":26}],\"righttop\":[{\"id\":15637,\"positionID\":27}],\"gridlist\":[{\"id\":12518643,\"positionID\":28},{\"id\":12532060,\"positionID\":28},{\"id\":12406406,\"positionID\":28},{\"id\":12408812,\"positionID\":28}],\"textlist\":[{\"id\":12533637,\"positionID\":41},{\"id\":12520657,\"positionID\":41},{\"id\":12531993,\"positionID\":41},{\"id\":12531992,\"positionID\":41},{\"id\":12523130,\"positionID\":41},{\"id\":12523640,\"positionID\":41},{\"id\":12523781,\"positionID\":41},{\"id\":12519304,\"positionID\":41},{\"id\":12523639,\"positionID\":41},{\"id\":12406410,\"positionID\":41},{\"id\":12399702,\"positionID\":41},{\"id\":12408997,\"positionID\":41},{\"id\":12407445,\"positionID\":41},{\"id\":12381205,\"positionID\":41},{\"id\":12380466,\"positionID\":41},{\"id\":12380465,\"positionID\":41},{\"id\":12380045,\"positionID\":41},{\"id\":12379973,\"positionID\":41},{\"id\":12384641,\"positionID\":41},{\"id\":12384576,\"positionID\":41}],\"newsfeed\":[{\"id\":12549017,\"content_type\":0,\"positionID\":23},{\"id\":12549079,\"content_type\":0,\"positionID\":23},{\"id\":12549124,\"content_type\":0,\"positionID\":23},{\"id\":12549148,\"content_type\":0,\"positionID\":23},{\"id\":12549149,\"content_type\":