INSERT INTO `tb_task_vulnerability` VALUES (1,'渗透漏洞','<div>\n<div>\n<h1>1、笛卡尔集</h1>\n<p><strong>1、什么是笛卡尔集</strong></p>\n<blockquote>\n<p>假设集合A={a,b},集合B={0,1,2},<br />则两个集合的笛卡尔集为　{(a,0),(a,1),(a,2),(b,0),(b,1),(b,2)}<br />可以拓展到多个集合的情况</p>\n</blockquote>\n<ul>\n<li>2、同时查询两个表(使用一个SQL语句),出现的就是笛卡尔集结果</li>\n</ul>\n<blockquote>\n<p>SELECT *<br />FROM students,score;</p>\n</blockquote>\n</div>\n<br /><br />作者：埃菲尔上的铁塔梦i<br />链接：https://www.jianshu.com/p/5fd0124866e0<br />来源：简书<br />著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。</div>',2,'<div>\n<div>&nbsp;</div>\n<br /><br />作者：埃菲尔上的铁塔梦i<br />链接：https://www.jianshu.com/p/5fd0124866e0<br />来源：简书<br />著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。</div>','2021-02-09 15:37:12.083588',2,1,2),(2,'严重漏洞','<p>test 的漏洞</p>',1,'<p>vfsd</p>','2021-07-02 15:30:22.441839',2,1,3);
